import react, { Component } from "react";



class Button extends Component {

    constructor (){
        super(); 
        this.defalutProps ={
            color : "green" , 
            text : "Add"
        }
    }
    render() {
        return (
            <button style={{backgroundColor : this.props.color}} className="btn nav-item text-white">{this.props.text}</button>


        );
    }
    
}
export default Button;
